To decide if S ⇒* t48 t11 t49 t48, we run the CYK algorithm.  After computing which nonterminals derive each substring:

1) Length‑1 spans:
   pos 1: t48  ⇒ {NT9}
   pos 2: t11  ⇒ {NT5, NT9}
   pos 3: t49  ⇒ {NT6}
   pos 4: t48  ⇒ {NT9}

2) Length‑2 spans:
   (1–2) ⇒ {NT3}
   (2–3) ⇒ {NT6, NT8}
   (3–4) ⇒ ∅

3) Length‑3 spans:
   (1–3) ⇒ {NT3, NT5}
   (2–4) ⇒ {NT7}

4) Length‑4 span (whole string):
   (1–4) ⇒ {NT9, NT2}

Since the start symbol S never appears in cell (1–4), the grammar does not generate t48 t11 t49 t48.  

No

By running the CYK algorithm on the 5‐token string t45 t34 t7 t21 t16, one finds for example

 span [1,2] ⇒ {NT6}  
 span [3,5] ⇒ {NT5,…}  

and since S→NT6 NT5, S covers [1,5].  
Therefore the grammar does generate the string.  
Yes
